// KAIROS ALPHA v1 ‚Äî Multi-Signal Scalper
// Dise√±ado por Mario Isaac @ Kairos 777
// Timeframe recomendado: 1m / 5m
// ‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê‚ïê

config({ stopLoss: 1.2, takeProfit: 2.0 });

// ‚îÄ‚îÄ‚îÄ Indicadores ‚îÄ‚îÄ‚îÄ
const r = rsi(14);
const emaFast = ema(8);
const emaMid = ema(21);
const emaSlow = ema(50);
const m = macd(12, 26, 9);
const bands = bb(20, 2);
const volAvg = avg(volume, 20);
const volNow = volume.value;
const volSpike = volNow > volAvg * 1.5;

// ‚îÄ‚îÄ‚îÄ Scoring system ‚îÄ‚îÄ‚îÄ
let bullScore = 0;
let bearScore = 0;

// RSI zones
if (r < 30) bullScore += 3;
else if (r < 40) bullScore += 1;
if (r > 70) bearScore += 3;
else if (r > 60) bearScore += 1;

// EMA alignment
if (emaFast > emaMid && emaMid > emaSlow) bullScore += 2;
if (emaFast < emaMid && emaMid < emaSlow) bearScore += 2;

// EMA crossovers
if (crossover(emaFast, emaMid)) bullScore += 2;
if (crossunder(emaFast, emaMid)) bearScore += 2;

// MACD
if (m.histogram > 0 && m.histogram > m.histogram.prev(1)) bullScore += 1;
if (m.histogram < 0 && m.histogram < m.histogram.prev(1)) bearScore += 1;
if (crossover(m.line, m.signal)) bullScore += 2;
if (crossunder(m.line, m.signal)) bearScore += 2;

// Bollinger Bands mean reversion
if (price < bands.lower) bullScore += 2;
if (price > bands.upper) bearScore += 2;

// Volume confirmation
if (volSpike) {
  bullScore += 1;
  bearScore += 1;
}

// ‚îÄ‚îÄ‚îÄ Price action ‚îÄ‚îÄ‚îÄ
const pctMove = percentChange(close, 3);
if (pctMove < -0.3) bullScore += 1;  // oversold bounce
if (pctMove > 0.3) bearScore += 1;  // overbought drop

log("üìä Bull: " + bullScore + " | Bear: " + bearScore + " | RSI: " + r.toFixed(1) + " | Vol: " + (volSpike ? "üî•SPIKE" : "normal"));

// ‚îÄ‚îÄ‚îÄ Execute trades ‚îÄ‚îÄ‚îÄ
if (bullScore >= 5 && bearScore < 3) {
  log("üü¢ COMPRA ‚Äî Score " + bullScore + " [RSI:" + r.toFixed(0) + " MACD:" + m.histogram.toFixed(2) + "]");
  buy();
}

if (bearScore >= 5 && bullScore < 3) {
  log("üî¥ VENTA ‚Äî Score " + bearScore + " [RSI:" + r.toFixed(0) + " MACD:" + m.histogram.toFixed(2) + "]");
  sell();
}`,createdAt:new Date().toISOString()},{id:"factory_scalper",name:"Scalper RSI+EMA",type:"custom_script",isFactory:!0,description:"Scalper con RSI y doble EMA crossover",code:`// Scalper ‚Äî RSI + EMA cross
