if (r > 65 && crossunder(fast, slow)) { log("üî¥ VENTA"); sell(); }
if (r > 78) { log("üî¥ RSI extremo"); sell(); }
if (r < 22) { log("üü¢ RSI extremo bajo"); buy(); }`,createdAt:new Date().toISOString()},{id:"factory_momentum",name:"Momentum MACD+BB",type:"custom_script",isFactory:!0,description:"Momentum trading con MACD y Bollinger Bands",code:`// Momentum MACD + Bollinger Bands
config({ stopLoss: 2, takeProfit: 3 });

const m = macd(12, 26, 9);
const bands = bb(20, 2);
